import React from 'react';
import {Nav, Navbar, NavbarBrand} from 'react-bootstrap';
import styled from 'styled-components';
// import NavbarToggle from 'react-bootstrap/NavbarToggle';
import NavbarCollapse from 'react-bootstrap/NavbarCollapse';

const Styles = styled.div`
    .navbar {
        background-color: #222;
    }

    .navbar-brand, .navbar-nav .nav-link {
        color: #bbb;
        &:hover {
            color:white;
        }
    }
`;

export const NavigationBar = () => (
    <Styles>
        <Navbar expand="lg">
            <NavbarBrand href="/">Code Life</NavbarBrand>
            <NavbarCollapse id='basic-navbar-nav'>
                <Nav className='ml-auto'>
                    <Nav.Item><Nav.Link href="/">Home</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/world">World</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/politics"></Nav.Link>Politics</Nav.Item>
                    <Nav.Item><Nav.Link href="/technology"></Nav.Link>Technology</Nav.Item>
                </Nav>
            </NavbarCollapse>
        </Navbar>
    </Styles>
)
